import './MainHeader';
import '../css/MainHeader.css';
import logo from '../../logo.svg';
const MainHeader = () => {
  return (
    <div
      className="SiteIcon"
      style={{height: 100, justifyContent: 'center', alignItems: 'center'}}
    >
      <img
        src={logo}
        style={{
          height: 60,
          marginLeft: 20,
          alignSelf: 'center',
          backgroundColor: 'black',
        }}
      ></img>
    </div>
  );
};
export default MainHeader;
